import {equipment} from './Models/equipmentModel';

const speaker: equipment = {
    id: 1,
    name: 'Speakers',
    price: 35
}

const booth: equipment = {
    id: 2,
    name: 'Booth',
    price: 55
}

const movingHead: equipment = {
    id: 3,
    name: 'Moving Head',
    price: 80

}

const bass: equipment = {
    id: 4,
    name: 'Bass',
    price: 60

}


export const equipmentList = {
    speaker,
    booth,
    movingHead,
    bass,
}
